(function () {
    // Listening for the appearance of the body element to execute the script as soon as possible before the `interactive` event.
    const config = { attributes: false, childList: true, subtree: true };
    const callback = function (mutationsList, observer) {
        for (const mutation of mutationsList) {
            if (mutation.type === 'childList') {
                if (document.getElementsByTagName('body')[0]) {
                     console.log('body element has appeared');
                    // Execute the script when the body element appears.
                    script();
                    // Mission accomplished, no more to observe.
                    observer.disconnect();
                }
                break;
            }
        }
    };
    const observer = new MutationObserver(callback);
    observer.observe(document, config);

    const onReadystatechange = function () {
        if (document.readyState == 'interactive') {
            script();
        }
    }
    // The script is mainly executed by MutationObserver, and the following listeners are only used as fallbacks.
    const addListeners = function () {
        // here don't use document.onreadystatechange, which won't fire sometimes
        document.addEventListener('readystatechange', onReadystatechange);

        document.addEventListener('DOMContentLoaded', script, false);

        window.addEventListener('load', script);
    }
    const removeListeners = function () {
        document.removeEventListener('readystatechange', onReadystatechange);

        document.removeEventListener('DOMContentLoaded', script, false);

        window.removeEventListener('load', script);
    }
    const script = function () {
        (function () {
     console.log('element hiding started on ' + document.location.href);

    // hide by injecting CSS
    var styleSheet = `{{STYLESHEET}}`;
    if (styleSheet.length) {
         console.log('stylesheet length: ' + styleSheet.length);
        // Why `html` here? Because the css at the end of `html` usually has a higher priority.
        var html = document.getElementsByTagName('html')[0];
        var style = document.createElement('style');
        html.appendChild(style);
        style.textContent = styleSheet;
         console.log('finished injecting stylesheet');
    } else {
         console.log('stylesheet is empty, skipped');
    }

    // hide by ExtendedCss
    try {
        var css = `{{CSS}}`;
         console.log(`ExtendedCss rules(length: ${css.length}) injecting for ${document.location.href}`);
        if (css.length > 0) {
            var extendedCss = new ExtendedCss({ styleSheet: css });
            extendedCss.apply();
        }
         console.log(`ExtendedCss rules success for ${document.location.href}`);
    } catch (err) {
         console.log(`ExtendedCss rules failed '${css}' for ${document.location.href} by ${err}`);
        throw err;
    }

     console.log('element hiding finished');
})();
        removeListeners();
    }
    if (document.readyState == 'interactive' || document.readyState == 'complete') {
        script();
    } else {
        addListeners();
    }
})();
